import { Box } from "@mui/material";
import { styled } from "@mui/system";

const FlexBetween = styled(Box)({ // it is good when we are reusing css as a component
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center"
})

export default FlexBetween;
